var Rohdaten, result, temp1, temp2, temp3, temp4, temp5, temp6, temp7, temp8, ServerRAMfrei, Laufzeit, ServerCPUauslastung, Harddisk_free, Harddisk_used, FutroBackup;

// Liest die Datei in Variablen ein und schreibt die Datenpunkte
async function Daten_auslesen() {
  await wait(2000);
  // liest die Temperaturwerte alle 5min aus
  exec('tail /opt/tausch/temperaturen.json', async (error, result, stderr) => {
    Rohdaten = result;
    temp1 = Rohdaten.slice(16, 23);
    temp2 = Rohdaten.slice(39, 46);
    temp3 = Rohdaten.slice(62, 69);
    temp4 = Rohdaten.slice(85, 92);
    temp5 = Rohdaten.slice(108, 115);
    temp6 = Rohdaten.slice(131, 138);
    temp7 = Rohdaten.slice(154, 161);
    temp8 = Rohdaten.slice(177, 184);
    ServerRAMfrei = Rohdaten.slice((((Rohdaten.indexOf('up ') + 1) - 14) - 1), (Rohdaten.indexOf('up ') + 1) - 10);
    Laufzeit = Rohdaten.slice(((Rohdaten.indexOf('up ') + 1 + 3) - 1), (Rohdaten.indexOf('user') + 1) - 5);
    ServerCPUauslastung = Rohdaten.slice(((Rohdaten.indexOf('average:') + 1 + 9) - 1), Rohdaten.indexOf('average:') + 1 + 12);
    Harddisk_free = Rohdaten.slice(((Rohdaten.indexOf('/dev/sda3') + 1 + 23) - 1), Rohdaten.indexOf('%') + 1 + -4);
    Harddisk_used = Rohdaten.slice(((Rohdaten.indexOf('/dev/sda3') + 1 + 17) - 1), Rohdaten.indexOf('%') + 1 + -10);
    FutroBackup = Rohdaten.slice(((Rohdaten.indexOf('FutroBackup:') + 1 + 15) - 1), (Rohdaten.indexOf('CET') + 1) - 2);
    setState('0_userdata.0.Server.Temp1' /* Temp1 */, Math.round(temp1 * 100) / 100, true);
    setState('0_userdata.0.Server.Temp2' /* Temp2 */, Math.round(temp2 * 100) / 100, true);
    setState('0_userdata.0.Server.Temp3' /* Temp3 */, Math.round(temp3 * 100) / 100, true);
    setState('0_userdata.0.Server.Temp4' /* Temp4 */, Math.round(temp4 * 100) / 100, true);
    setState('0_userdata.0.Server.Temp5' /* Temp5 */, Math.round(temp5 * 100) / 100, true);
    setState('0_userdata.0.Server.Temp6' /* Temp6 */, Math.round(temp6 * 100) / 100, true);
    setState('0_userdata.0.Server.Temp7' /* Temp7 */, Math.round(temp7 * 100) / 100, true);
    setState('0_userdata.0.Server.Temp8' /* Temp8 */, Math.round(temp8 * 100) / 100, true);
    setState('0_userdata.0.Server.freeMemory' /* freeMemory */, ServerRAMfrei, true);
    setState('0_userdata.0.Server.uptime' /* uptime */, Laufzeit, true);
    setState('0_userdata.0.Server.average' /* average */, ServerCPUauslastung, true);
    setState('0_userdata.0.Server.freeDiskspace' /* freeDiskspace */, Harddisk_free, true);
    setState('0_userdata.0.Server.usedDiskspace' /* usedDiskspace */, Harddisk_used, true);
    setState('0_userdata.0.Server.letztes_FutroBackup' /* letztes FutroBackup */, FutroBackup, true);
  });
}


schedule("*/5 * * * *", async () => {
  if (compareTime('08:00', '22:00', 'between')) {
    await Daten_auslesen();
  } else {
    if ((new Date().getMinutes()) == 0) {
      await Daten_auslesen();
    } else if ((new Date().getMinutes()) == 15) {
      await Daten_auslesen();
    } else if ((new Date().getMinutes()) == 30) {
      await Daten_auslesen();
    } else if ((new Date().getMinutes()) == 45) {
      await Daten_auslesen();
    } else {
      // wenn au√üerhalb des 15min-takt
    }
  }
});


